import React, { Component } from "react";
import { View, Text, StyleSheet } from "react-native";
import { Input, Button } from '../../components';

export default function HomeAdminitrador({navigation}){

    const NavigateCurso=()=>{
        navigation.navigate('GestionCurso');
    }

    const NavigateDocente=()=>{
        navigation.navigate('GestionDocente');
    }
    //  NavigateEstudiante=()=>{
    //     navigation.navigate('GestionEstudiante');
    // }

    return (
        <View style={style.container}>
            <View style={style.containertitulo}>
                <Text style={style.titulo}>ADMINISTRADOR</Text>
            </View>
            <View style={style.containerButton}>
                <Button
                    title="Gestión de Cursos"
                    onPress={NavigateCurso}
                />
                <Button
                    title="Gestión de Docentes"
                    onPress={NavigateDocente}
                />
                <Button
                    title="Gestión de Estudiantes"
                    onPress={()=>navigation.pushj('GestionEstudiante')}
                />
            </View>
        </View>
    ); 
}

const style = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'flex-start',
        alignItems: 'center',
        backgroundColor: 'white'
    },
    containertitulo: {
        height: '15%',
        justifyContent: 'center',
    },
    titulo: {
        fontSize: 25,
        color : 'black',
        fontWeight: 'bold',
    },
    containerButton: {
        justifyContent: 'space-evenly',
        flex: 1
    },
});
